import { featuredPortfolio } from './data.js';
import Card from './Card.jsx';

function Portfolio() {
  return (
    <div className="portfolio">
      {featuredPortfolio.map((item) => (
        <Card key={item.id} item={item} />
      ))}
    </div>
  );
}

export default Portfolio;
